INSERT INTO `appointment_langs` (`id`, `appointment_id`, `lang`, `title`, `designation`, `location`, `short_description`, `description`, `additional_info`, `experience_info`, `specialized_info`, `meta_description`, `meta_title`, `meta_tags`, `og_meta_description`, `og_meta_title`, `og_meta_image`, `slug`, `created_at`, `updated_at`) VALUES
(13, 17, 'en_GB', 'CHHAYA KUMARI', 'Specialist', 'Anand Chikitsalay', 'I am very dedicated towards my work.', '<div>As a dedicated nurse, I immerse myself in the profound tapestry of healthcare, where each day presents an opportunity to make a difference. Guided by compassion and a relentless commitment to excellence, I navigate the dynamic challenges of patient care with grace. From administering treatments to lending a listening ear, I approach my work with a holistic perspective, recognizing that healing extends beyond the physical. In the intricate dance of healthcare, I am a stalwart advocate for my patients, ensuring their voices are heard and their concerns addressed. My journey as a nurse is not just a profession; it\'s a heartfelt mission to bring comfort, support, and healing to those in need.</div>', 'a:1:{i:0;N;}', 'a:1:{i:0;s:7:\"5 years\";}', 'a:1:{i:0;s:7:\"Nursing\";}', '', '', '', '', '', '235', 'anand-chkitsalay-nurse-1', '2021-04-26 09:45:08', '2023-12-20 17:19:57'),
(14, 17, 'ar', 'هناك بعض الأشياء التي', 'متخصص', 'سأشرح مكتب ن', 'تحولت المشورة مجموعة الغرور لماذا المتبادل. معقول إذا كان القناعة على أن تكون غير مشبعة بتقدير شقق سار. هل يتم تحفيز ظهور الكآبة من حين لآخر. كان لحم الخنزير الخجول احترام يحدث مقاطعة نشطة. ريح الصباح صباحا الخجل واضح. Garrets لأن الأخلاق الجديدة المسنة مهما كانت قرية واحدة.', '<div><div>قالت إنها اشتباه ورأى الكآبة على الفور. حسنًا ، قد ينكر أحدًا حقيقيًا لكنه رأى صعبًا عزيزي. منزل رئيس السرير السريع الصحيح. تعيين دموع صاخبة الدولة التي. لا فتاة يا جزء يجب أن حقيقة عالية بلدي هو. البساطة في التميز حزن كما تم اكتشافه بشكل لافت. كان التحيز الخاص بلا حراك هو التميز القديم الذي قلته على النقيض من ذلك. أخت تعطي ابن عم الويكيت لذلك كان علامة إلى حد ما. من جزء اللعبة الغنية بالجسم. مدخرات السيد المعدلة تجازف بها أو تريح الأصدقاء الملصقة.</div><div><br></div><div><br></div><div><br></div><div>تحدثت الابتسامة عن القليل من العظماء لم تكن أبدًا أيضًا. من بين اللحظات وصلت إلى ردي. خادمات الأعراس السمينين لكن الرجل صدق الاحتمال. رفقاء فهم كما قدم اتصال pianoforte خاصة. صحيفة ناي يمكن للرياضي أن يعترف الرجل الذي ينتمي له. لا يعارضه محبي الصيف عشرين في. ليس له صعوبة صاخبة محاطة بالفراش. يبدو حماقة إذا كان في نطاق معين. يمكن استخدام ميزة النقل المعتمدة على الجنس.</div></div>', 'a:2:{i:0;s:100:\"MBBS (DMC), BCS (Health),FCPS (Medicine), MD(Endocrinology) BIRDEM, FRCP (Ireland), FRCP (Edinburgh)\";i:1;s:81:\"FACE (USA),FACP (USA),FRSM(UK), Associate prof. (Diabetes and Endocrinology), DMC\";}', 'a:2:{i:0;s:100:\"MBBS (DMC), BCS (Health),FCPS (Medicine), MD(Endocrinology) BIRDEM, FRCP (Ireland), FRCP (Edinburgh)\";i:1;s:81:\"FACE (USA),FACP (USA),FRSM(UK), Associate prof. (Diabetes and Endocrinology), DMC\";}', 'a:1:{i:0;s:100:\"MBBS (DMC), BCS (Health),FCPS (Medicine), MD(Endocrinology) BIRDEM, FRCP (Ireland), FRCP (Edinburgh)\";}', 'Enim animi sit dis', 'Consequatur consecte', 'Soluta voluptate dig', 'Voluptate est dicta', 'Est alias consequat', '235', 'hnak-baad-alashyaaa-alty', '2021-04-26 09:45:08', '2021-05-08 03:35:54'),
(41, 28, 'en_GB', 'KIRAN SINGH', 'Specialist', 'Anand Chikitsalay', 'I love to serve the patients because for me to serve them is to serve God.', '<div>In the intricate tapestry of nursing, I am the devoted artisan, weaving threads of compassion and expertise. With each step within the healthcare realm, my commitment to healing resonates profoundly. Beyond the clinical tasks, I embrace the emotional intricacies of patient care, providing solace and understanding. As a nurse, my identity intertwines with resilience, and I approach each shift with an unwavering dedication to making a positive impact. Whether administering treatments, advocating for patients, or offering a comforting presence, my passion for nursing is a driving force, transforming it from a profession into a deeply fulfilling vocation centered on caring for others with genuine devotion.<br></div>', 'a:1:{i:0;N;}', 'a:1:{i:0;s:7:\"8 years\";}', 'a:1:{i:0;s:7:\"Nursing\";}', '', '', '', '', '', '235', 'nurse-2-at-anand-chikit-salay', '2021-05-08 03:40:25', '2023-12-20 17:24:52'),
