 03:41:46'),
(43, 29, 'en_GB', 'REEMA KUMARI', 'Specialist', 'Anand Chikitsalay', 'I have practicing nursing from many years with not only aim as job but with the aim to serve the humanity.', '<div>As a dedicated nurse, I immerse myself in the profound responsibility of healthcare, where every moment is an opportunity to make a positive impact. With a compassionate heart and a commitment to healing, I navigate the complex tapestry of patient care. Whether administering treatments, offering a comforting presence, or collaborating with a multidisciplinary team, my dedication is the driving force. Beyond the clinical tasks, I invest time in understanding each patient\'s unique needs, ensuring a holistic approach to well-being. Every day, I embrace the challenges, joys, and intricacies of nursing, knowing that my unwavering dedication contributes to the betterment of lives.<br></div><div><br></div>', 'a:1:{i:0;N;}', 'a:1:{i:0;s:7:\"4 years\";}', 'a:1:{i:0;s:7:\"Nursing\";}', '', '', '', '', '', '235', 'anand-chkitsalay-nurse-3', '2021-05-08 03:45:08', '2023-12-20 17:26:06'),
