(45, 30, 'en_GB', 'SUDHA DEVI', 'Specialist', 'Anand Chikitsalay', 'I feel lucky as I enjoy to work for the new born babies because we can see God in them.', '<div>As a dedicated nurse, I am fueled by a profound passion for healing and nurturing. Each day, I enter the healthcare arena with a commitment that goes beyond duty; it\'s a personal vow to make a positive impact. From administering medications to offering empathetic support, my role extends beyond the clinical to touch the lives of those in need. The heartbeat of my profession is the genuine care I provide, connecting with patients on a human level. I am not merely a practitioner but a compassionate advocate, navigating the complexities of healthcare with diligence, empathy, and an unwavering dedication to fostering well-being.<br></div><div><br></div>', 'a:1:{i:0;N;}', 'a:1:{i:0;s:7:\"6 years\";}', 'a:1:{i:0;s:7:\"Nursing\";}', '', '', '', '', '', '235', 'anand-chikitsalay-nurse-4', '2021-05-08 03:49:18', '2023-12-20 17:26:35'),
(46, 30, 'ar', 'هناك بعض الأشياء التي', 'متخصص', 'سأشرح مكتب ن', 'تحولت المشورة مجموعة الغرور لماذا المتبادل. معقول إذا كان القناعة على أن تكون غير مشبعة بتقدير شقق سار. هل يتم تحفيز ظهور الكآبة من حين لآخر. كان لحم الخنزير الخجول احترام يحدث مقاطعة نشطة. ريح الصباح صباحا الخجل واضح. Garrets لأن الأخلاق الجديدة المسنة مهما كانت قرية واحدة.', '<div><div>قالت إنها اشتباه ورأى الكآبة على الفور. حسنًا ، قد ينكر أحدًا حقيقيًا لكنه رأى صعبًا عزيزي. منزل رئيس السرير السريع الصحيح. تعيين دموع صاخبة الدولة التي. لا فتاة يا جزء يجب أن حقيقة عالية بلدي هو. البساطة في التميز حزن كما تم اكتشافه بشكل لافت. كان التحيز الخاص بلا حراك هو التميز القديم الذي قلته على النقيض من ذلك. أخت تعطي ابن عم الويكيت لذلك كان علامة إلى حد ما. من جزء اللعبة الغنية بالجسم. مدخرات السيد المعدلة تجازف بها أو تريح الأصدقاء الملصقة.</div><div><br></div><div><br></div><div><br></div><div>تحدثت الابتسامة عن القليل من العظماء لم تكن أبدًا أيضًا. من بين اللحظات وصلت إلى ردي. خادمات الأعراس السمينين لكن الرجل صدق الاحتمال. رفقاء فهم كما قدم اتصال pianoforte خاصة. صحيفة ناي يمكن للرياضي أن يعترف الرجل الذي ينتمي له. لا يعارضه محبي الصيف عشرين في. ليس له صعوبة صاخبة محاطة بالفراش. يبدو حماقة إذا كان في نطاق معين. يمكن استخدام ميزة النقل المعتمدة على الجنس.</div></div>', 'a:2:{i:0;s:100:\"MBBS (DMC), BCS (Health),FCPS (Medicine), MD(Endocrinology) BIRDEM, FRCP (Ireland), FRCP (Edinburgh)\";i:1;s:81:\"FACE (USA),FACP (USA),FRSM(UK), Associate prof. (Diabetes and Endocrinology), DMC\";}', 'a:2:{i:0;s:100:\"MBBS (DMC), BCS (Health),FCPS (Medicine), MD(Endocrinology) BIRDEM, FRCP (Ireland), FRCP (Edinburgh)\";i:1;s:81:\"FACE (USA),FACP (USA),FRSM(UK), Associate prof. (Diabetes and Endocrinology), DMC\";}', 'a:1:{i:0;s:100:\"MBBS (DMC), BCS (Health),FCPS (Medicine), MD(Endocrinology) BIRDEM, FRCP (Ireland), FRCP (Edinburgh)\";}', 'Enim animi sit dis', 'Consequatur consecte', 'Soluta voluptate dig', 'Voluptate est dicta', 'Est alias consequat', '235', 'hnak-baad-alashyaaa-alty-25-08-18', '2021-05-08 03:49:18', '2021