(9, 'We provide treatment of infertility for both men and women.', 'Infertility Services', 'We are famous for treatment of infertility for both men and women and have treated successfully more than 600 patients from ayurvedic medicines. We also treat all types of sexual disorder from natural medicines.', 'fas fa-user-md', '326', 'Male Infertility \r\nFemale Infertility\r\nLow Sperm count in Male\r\nLack of eggs in Ovary in female\r\nErectile Disfunctioning\r\nPremature Ejaculation\r\nLow Libido', 'en_GB', '2021-04-18 01:26:02', '2023-12-02 02:07:59'),
(10, 'We provide ayurvedic medicines for all treatments.', 'AYURVEDIC MEDICINES', 'We believe in natural treatment of the body. So we focus mostly on ayurvedic treatments. We perform treatment of all major diseases from ayurvedic medicines. We provide ayurvedic medicines of all major brands such as OK life care, Patanjali, Himalaya, etc.  We perform treatment of following diseases from ayurvedic medicines.', 'fas fa-mortar-pestle', '322', 'Diabetes\r\nHeart Problems\r\nLiver Issues\r\nArthritis \r\nPiles\r\nMigraine\r\nKidney\r\nSkin Diseases \r\nInfertility (Male / Female)\r\nBrain Tumer', 'en_GB', '2021-04-18 01:26:02', '2023-11-24 02:52:14'),
