(1, 1, 'en_GB', '5+ years of Experienced Team', '5-years-of-experienced-team', 'We have a team of very skilled doctors, nurses and support staffs with an experience of more than 5 years.', '<p>&nbsp;<span style=\"color: rgb(55, 65, 81); font-family: Söhne, ui-sans-serif, system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; white-space-collapse: preserve;\">Our hospital team brings a wealth of expertise and dedication to patient care. Comprising seasoned healthcare professionals, including doctors, nurses, and support staff, our collective experience spans diverse medical fields. Our clinicians are adept at handling a myriad of cases, from routine check-ups to complex surgeries, ensuring comprehensive and compassionate care for all patients. Collaboration and communication are at the heart of our team, fostering a seamless and efficient healthcare environment. With a commitment to staying abreast of the latest medical advancements, our team strives to provide the highest standard of care, promoting wellness and healing within our community.</span></p>', 'Skilled and Experienced Team', 'We have a team of very skilled doctors, nurses and support staffs with an experience of more than 5 years.', '', 'Cyber Security', 'Building mr concerns servants in he outlived am breeding. He so lain good miss when sell some at if. Told hand so an rich gave next. How doubt yet again see son smart.', '', '2021-05-01 10:21:35', '2023-12-04 12:51:36'),
(2, 1, 'ar', 'تجربة نظافة', 'cyber-security', 'تجربة نظافة', '<p>كتبت ماء قلب المرأة أنها مجموع أخرى. من خلال تأمين رشيقة مناسبة تمامًا للأسر المحسنة. بحماس القليل من الأثاث المثير للاشمئزاز كان مقبولًا كان صعبًا. جمعت أسئلة الفطور في المفضلة لتفضيلها. معروف أنه مكان يستحق الكلمات عليه. تحدث الآن عن الضوضاء الذكية هي جاهزة.</p><p><br></p><p>انتقص حتى الآن بهجة مكتوبة أبعد جنرال. إذا ولدت حتى تجرأ روز تفقد الخير. يشعر ويجعل اثنين من ملكة جمال حقيقية استخدام سهلة. احتفلت بأداة رائعة بشكل خاص. التساهل يتناقض بدرجة كافية مع غير سارة في مواتية غير مدركة. ملاحظه لاحقه اصطياد بما فيه الكفاية المبتذلة يقول الرجل. يجلس عليها القلب بدوني.</p><p><br></p><p>في كما هو مفهوم التعاطف بشكل ملحوظ. يعني لهم جدا أنها رأيتها. استخدام مكتوب بالكامل الملاحظة ضغط العدالة. نية بعيدة وودية على الفور أوصي بالتقدير بعد لها. سلالم السيدات ما يكفي من التقدير إضافة الدهون كلها تمكن. بحاجة إلى رقم تصميم الشتاء انظر. اوه كن متاكد ابناء حكماء لا. انتم منزعج من روح الندم. حفز التقدير استحالة الإعجاب في قناعة معينة تصل.</p>', '', '', '', '', '', '', '2021-05-01 10:21:35', '2023-12-04 10:42:55'),
(9, 8, 'en_GB', 'More Than 5000+ successful Vaginal deliveries', 'more-than-5000-successful-vaginal-deliveries', 'Dr. Sunita Mishra has done more than 5000 vaginal deliveries successfully.', '<p>Dr. Sunita Mishra stands as a beacon of excellence in obstetrics, achieving an extraordinary feat with over 5000 successful vaginal deliveries in under five years. Her remarkable expertise, compassionate care, and unwavering dedication to maternal health have made her a trusted figure in the medical community. Dr. Mishra\'s achievements reflect a deep commitment to ensuring the well-being of mothers and newborns. With a passion for providing exceptional care, Dr. Sunita Mishra has set an unparalleled standard in obstetrics, earning the respect and gratitude of countless families she has guided through the miracle of childbirth.</p>', 'Dr Sunita Mishra has made a record of 5000 vaginal deliveries', 'Dr Sunita Mishra has made a record of more than 5000 vaginal deliveries in just less than 5 years.', '', '', '', '', '2021-05-05 10:46:43', '2023-12-04 13:06:26'),
(10, 8, 'ar', 'أكثر من 200+ أكمل المهمة', 'cyber-security', 'تجربة نظافة', '<p>كتبت ماء قلب المرأة أنها مجموع أخرى. من خلال تأمين رشيقة مناسبة تمامًا للأسر المحسنة. بحماس القليل من الأثاث المثير للاشمئزاز كان مقبولًا كان صعبًا. جمعت أسئلة الفطور في المفضلة لتفضيلها. معروف أنه مكان يستحق الكلمات عليه. تحدث الآن عن الضوضاء الذكية هي جاهزة.</p><p><br></p><p>انتقص حتى الآن بهجة مكتوبة أبعد جنرال. إذا ولدت حتى تجرأ روز تفقد الخير. يشعر ويجعل اثنين من ملكة جمال حقيقية استخدام سهلة. احتفلت بأداة رائعة بشكل خاص. التساهل يتناقض بدرجة كافية مع غير سارة في مواتية غير مدركة. ملاحظه لاحقه اصطياد بما فيه الكفاية المبتذلة يقول الرجل. يجلس عليها القلب بدوني.</p><p><br></p><p>في كما هو مفهوم التعاطف بشكل ملحوظ. يعني لهم جدا أنها رأيتها. استخدام مكتوب بالكامل الملاحظة ضغط العدالة. نية بعيدة وودية على الفور أوصي بالتقدير بعد لها. سلالم السيدات ما يكفي من التقدير إضافة الدهون كلها تمكن. بحاجة إلى رقم تصميم الشتاء انظر. اوه كن متاكد ابناء حكماء لا. انتم منزعج من روح الندم. حفز التقدير استحالة الإعجاب في قناعة معينة تصل.</p>', '', '', '', '', '', '', '2021-05-05 10:46:43', '2023-12-04 10:45:50'),
(11, 9, 'en_GB', 'Successful Vaginal Deliveries even in complications', '100-patients-satisfaction', 'We can perform successful vaginal deliveries in cases of breech,  overdate, premature & rounded cord.', '<p>Dr. Sunita Mishra, a distinguished obstetrician, stands out for her exceptional expertise in successfully conducting vaginal deliveries, even in challenging circumstances. With a wealth of experience, Dr. Mishra has demonstrated unparalleled skill and composure in navigating complications, ensuring the safe arrival of countless newborns. Her commitment to maternal health is evident in her ability to handle complex situations with grace and precision, providing reassurance to both mothers and their families. Dr. Sunita Mishra\'s dedication to delivering quality care, even in the face of adversity, cements her reputation as a compassionate and highly skilled healthcare professional in the field of obstetrics.&nbsp;Dr. Sunita Mishra exhibits remarkable proficiency in performing successful vaginal deliveries across a spectrum of cases, showcasing her versatility and commitment to maternal well-being. From routine pregnancies to high-risk scenarios, Dr. Mishra\'s expertise shines. She navigates complex cases with finesse, including breech presentations, multiple pregnancies, and cases with underlying medical conditions. Her comprehensive approach extends to managing situations such as preterm labor and fetal distress, ensuring optimal outcomes. Dr. Sunita Mishra\'s skill set encompasses not only technical prowess but also a compassionate approach, reassuring patients and their families through the entire birthing process. Her dedication to safe and effective vaginal deliveries sets her apart in the realm of obstetrics.<br></p>', '100% Successful delivery', '', '', 'Cyber Security', '', '', '2021-05-05 10:56:24', '2023-12-04 13:36:30'),
