(13, 10, 'en_GB', 'Low Medical Cost', 'low-medical-cost', 'The overall medical cost of treatment at our hospital will be Low as compared to other private hospitals.', '<p>Our hospital is dedicated to breaking barriers to healthcare by offering high-quality medical services at remarkably low costs. Committed to making healthcare accessible to all, we prioritize affordability without compromising on excellence. Our state-of-the-art facilities and a team of skilled professionals ensure that patients receive comprehensive care without the burden of exorbitant expenses. From routine check-ups to specialized treatments, we believe in fostering a healthy community by providing cost-effective healthcare solutions. At our institution, compassionate and affordable medical care converge, creating a welcoming environment where individuals can prioritize their well-being without financial strain. Your health is our priority, without the hefty price tag.</p>', '', '', '', '', '', '', '2021-05-05 10:58:28', '2023-12-04 13:43:13'),
