INSERT INTO `testimonials` (`id`, `name`, `image`, `description`, `designation`, `rating_star`, `lang`, `created_at`, `updated_at`) VALUES
(1, 'Basant Mishra', '368', 'I have seen that Dr. Sunita Mishra has made many successful vaginal deliveries even in complications too.', 'Founder', 5, 'en_GB', '2020-01-04 12:33:19', '2023-12-25 17:21:00'),
(2, 'Omkar Nath Pandey', '370', 'My disease has been cured by the ayurvedic medicine given by Dr. Sunita Mishra. She is the most honest and expert doctor I have ever seen in the field of ayurveda.', 'General Member', 5, 'en_GB', '2020-01-04 12:33:56', '2023-12-25 17:20:20'),
(3, 'Pankaj Pandey', '366', 'In my experience, Dr. Sunita Mishra is the best Doctor, if you want normal delivery of your baby.  I would say that you can believe her confidently.', 'Founder', 5, 'en_GB', '2020-01-04 12:34:15', '2023-12-25 17:21:58'),
(8, 'دونالد مورو', '231', 'وجدت نفسي أعمل في شراكة حقيقية تؤدي إلى تجربة مدهشة ، ومنتج يمثل أفضل الخدمات.', 'مؤسس', 5, 'ar', '2021-03-14 05:35:06', '2021-04-21 00:34:01'),
(9, 'جيمس كيرتس', '232', 'وجدت نفسي أعمل في شراكة حقيقية تؤدي إلى تجربة مدهشة ، ومنتج يمثل أفضل الخدمات.', 'عضو عام', 5, 'ar', '2021-03-14 05:35:29', '2021-04-21 00:33:53'),
(10, 'ستيفن بيركنز', '235', 'وجدت نفسي أعمل في شراكة حقيقية تؤدي إلى تجربة مدهشة ، ومنتج يمثل أفضل الخدمات.', 'مؤسس', 5, 'ar', '2021-03-14 05:35:45', '2021-04-21 00:33:35');
